      $(function() {
          $( "#accordion" ).accordion({
            heightStyle: "content",
            collapsible: true,
            active: "none",
            animate: 300,
            activate: function(event, ui) {
              try {
                  theOffset = ui.newHeader.offset();
                  $('body,html').animate({ 
                      scrollTop: theOffset.top -83
                  });
              } catch(err){}
            }
          });

          $("#typed").typed({
              stringsElement: $('#typed-strings'),
              typeSpeed: 50,
              backDelay: 1000,
              loop: true,
            });
        });

        function scrollDown(){
          $("#arrowBounce" ).click();
        };

        function change(){
          $('h3#accordian-header-text').addClass("active");
        };

        function doddleCall(){
          if($('#accordion h3').hasClass('ui-state-active')) {
              $(".doddle-click").click(); 
              $(".doddle-click").click(); 
            } else {
              $(".doddle-click").click(); 
            }
          }
        var fix = 0;
        function showmap() { 
          fix = 1;
          function initialize() {
            var map = new google.maps.Map(document.getElementById('googlemaps'), {
              center: {lat: 53.3004978, lng: -6.2838544},
              zoom: 14,
              scrollwheel: false,
              styles: [
                {
                  featureType: 'all',
                  stylers: [
                    { saturation: -80 }
                  ]
                },
                {
                    "featureType": "water",
                    "stylers": [
                        {
                            "color": "#73D4C0"
                        }
                    ]
                },
                {
                  featureType: 'road.arterial',
                  elementType: 'geometry',
                  stylers: [
                    { hue: '#00ffee' },
                    { saturation: 50 }
                  ]
                },{
                  featureType: 'poi.business',
                  elementType: 'labels',
                  stylers: [
                    { visibility: 'off' }
                  ]
                }
              ]
              
            });

            var mapOptions = {
              center: {lat: 53.3004978, lng: -6.2838544},
              zoom: 14, 
              scrollwheel: false,
              animation: google.maps.Animation.DROP
              };

            var marker = new google.maps.Marker({
              position: {lat: 53.3004978, lng: -6.2838544},
              map: map
            });
            
          }
          initialize();
        }


// Tooltips, smooth scroll, navbar fade, accordian colour change
      $(document).ready(function(){
        $('a').tooltip();
        $('i').tooltip();
        // arrow smooth scroll
        $('a[href^="#"]').on('click',function (e) {
            e.preventDefault();
            var target = this.hash;
            var $target = $(target);
            $('html, body').stop().animate({
                'scrollTop': $target.offset().top
            }, 900, 'swing', function () {
                window.location.hash = target;
            });
        });

        // Transition effect for navbar 
        $(window).scroll(function() {
            // checks if window is scrolled more than 700px, adds/removes solid class
            if($(this).scrollTop() > 700) { 
                $('.navbar').addClass('solid');
                $('#top-logo').fadeIn(1000);
            } else {
                $('.navbar').removeClass('solid');
                $('#top-logo').fadeOut(1000);
            }

            if($(window).scrollTop() + $(window).height() > $(document).height() - 250) {
              if(fix==1){
                return
              } else {
                 //$(window).unbind('scroll');
                 showmap();
               }
             }
          })

        $("h3#accordian-header-text").click(function() {
          var $this = $(this);        
          $("h3#accordian-header-text").removeClass("active");
          $this.addClass("active");
        });
      });

